      amount: 12.5,
      date: new Date(2022, 4, 12)
    },
    {
      id: "e3",
      title: "Paper Bags",
      amount: 89.4,
      date: new Date(2022, 4, 12)
    },
  ];

  const addExpenseHandler = (value) => {
    console.log("In app.js");
    console.log(value);
  }

  return (
    <div>
      <NewExpense onAddExpense = {addExpenseHandler}/>
      <Expenses item = {expenses}/>
    </div>
  );
}

export default App;
